import * as BadgeController from "../Controllers/BadgeController"

describe("Check if badge information is displayed correctly", () =>{
    let originalFetch;
    beforeEach(() => {
        originalFetch = global.fetch;
        global.fetch = jest.fn(() => Promise.resolve({
            json: () => Promise.resolve(
                {
                    "@context": "https://www.wikidata.org/wiki/Q491",
                    "type": "Badge",
                    "name": "Friendly",
                    "content": "This user has shown friendly behavior",
                    "icon": {
                        "type": "Image",
                        "content": ""
                    }
                }
            )}));})
    afterEach(() => {
        global.fetch = originalFetch;
    });
    it("Check if the response is in the correct format.",async () => {
        const response = await BadgeController.getBadgeDetails("Friendly")
        expect(response).toEqual({
            name:"Friendly",
            icon:"",
            description:"This user has shown friendly behavior"
        })
    })
})

